import React from 'react';

export class Login extends React.Component {
    constructor() {
        this.state = {
            email: "",
            password: ""
        }
    }

    render() {
        const {email, password} = this.state;
        return (
        <div>
            <input type="email" value={email} onChange={e => this.setState({email: e})}/>
            <input type="password" value={password} onChange={e => this.setState({password: e})}/>
            <button type="submit">Submit</button>
        </div>
        );
    }

}
